import Select from 'react-select'

const SelectionMenu = () => {
    const options = [
        { value: 'wildfire', label: 'WildFires' },
        { value: 'volcano', label: 'Volcanoes' },
      ]
    return (
        <div className="selection-menu">
            <Select options={options} />
        </div>
    )
}

export default SelectionMenu;
